private static Hashtable importFile(Hashtable myHashtable, String myFileName) \n{\n    StreamReader sr = new StreamReader(myFileName);\n    CSVReader csvReader = new CSVReader();\n    ArrayList duplicateKeys = new ArrayList(); // List to store duplicate keys\n    int count = 0;\n\n    while (!sr.EndOfStream)\n    {\n        String temp = sr.ReadLine();\n        if (temp.StartsWith(" "))\n        {\n            ServMissing.Add(temp); // Assuming ServMissing is defined elsewhere in your code\n        }\n        else\n        {\n            ArrayList tempArray = csvReader.CSVParser(temp);\n            Boolean first = true;\n            String key = "";\n            String value = "";\n\n            foreach (String x in tempArray)\n            {\n                if (first)\n                {\n                    key = x;\n                    first = false;\n                }\n                else\n                {\n                    value += x + ",";\n                }\n            }\n\n            try\n            {\n                myHashtable.Add(key, value);\n            }\n            catch (ArgumentException) // Catch exception for duplicate keys\n            {\n                duplicateKeys.Add(key); // Add duplicate key to the list\n            }\n        }\n        count++;\n    }\n\n    sr.Close(); // Always close your stream\n\n    Console.WriteLine("Import Count: " + count);\n    Console.WriteLine("Duplicate Keys Count: " + duplicateKeys.Count);\n\n    // Optionally, handle or log the duplicate keys as needed\n    foreach (string dupKey in duplicateKeys)\n    {\n        Console.WriteLine("Duplicate Key Found: " + dupKey);\n    }\n\n    return myHashtable;\n}